import math
import bisect
_l = [n for n in range(10)]
for i in range(3, 19):
    j = 1
    while j < len(_l):
        if i == int(math.log10(_l[j] * i)) + 1:
            _l.append(_l[j] * i)
        j += 1

def s(n):
    return bisect.bisect(_l, n)

def count_strange_numbers(L, R):
    if L == 0:
        return s(R)
    else:
        return s(R) - s(L - 1)

